CREATE DATABASE plato;

USE plato

CREATE TABLE reviews (
  ID int NOT NULL AUTO_INCREMENT,
  productId int,
  title varchar(200),
  username varchar(22) NOT NULL,
  review varchar(1000) NOT NULL,
  date varchar(15),
  stars int NOT NULL,
  upvotes int NOT NULL,
  downvotes int NOT NULL,
  PRIMARY KEY (ID)

);





